const csv = pesquisas
.filter(pesquisa => {
    return hasDadosEstado(pesquisa.contexto) || hasDadosMunicipio(pesquisa.contexto) || hasDadosBrasil(pesquisa.contexto);
})
.map(pesquisa => {
    pesquisa.contexto.split('');
    return `"${pesquisa.nome}", ${pesquisa.id}, ${hasDadosMunicipio(pesquisa.contexto) ? 'X' : ''}, ${hasDadosEstado(pesquisa.contexto) ? 'X' : ''}, ${hasDadosBrasil(pesquisa.contexto) ? 'X' : ''}`
}).join('\n');

fs.writeFileSync('pesquisas.csv', header + csv, 'utf-8');
